import { Button, Grid, Stack, IconButton, Typography } from "@mui/material";

import AccountCircleRoundedIcon from "@mui/icons-material/AccountCircleRounded";
import { Interactions } from "./Interactions";

export const Content = () => {
  return (
    <Grid
      container
      justifyContent={"center"}
      alignContent={"space-between"}
      sx={{ width: "50%", height: "50%", border: "2.5px white solid" }}
    >
      <Grid item container>
        <Grid item>
          <AccountCircleRoundedIcon sx={{ fontSize: "50px" }} color="primary" />
        </Grid>
        <Grid item>
          <Typography variant="body1" component={"p"} color={"#fff"}>
            10/12/16
          </Typography>
        </Grid>
      </Grid>
      <Grid item md={12} mx={1}>
        <Interactions />
      </Grid>
    </Grid>
  );
};
